import React from "react";
import { BrowserRouter as Router, Link, Route, Switch, useRouteMatch } from 'react-router-dom'; 

import Product from "../Product/Product";
import Inventory from "../Inventory/Inventory";
import Payment from "../Payment/Payment";
import Account from "../Account/Account";
import NavBar from "../../UI/NavBar/NavBar";

import styles from './AdminDashboard.module.css';
import { withRouter } from "react-router";

const AdminDashboard = (props) =>{

    let { path, url } = useRouteMatch();
    const navbar = [
        {
            id_num:1,
            id: "manage-products",
            path: '/manage-products',
            li: "Manage Products",
        },
        {
            id_num:2,
            id: "manage-inventory",
            path: '/manage-inventory',
            li: "Manage Inventory",
        },
        {
            id_num:3,
            id: "manage-payments",
            path: '/manage-payments',
            li: "Manage Payments",
        },
        {
            id_num:4,
            id: "manage-accounts",
            path: '/manage-accounts',
            li: "Manage Accounts",
        },
    ]

return(   

            <div className={`${styles.container}`}>
            <Router>
            <ul className={`${styles.sidenav}`}>
                <p>{JSON.stringify(url)}</p>
                {navbar.map((nav)=>
                    <Link key={nav.id_num} id={nav.id} className={`${styles.li} menu-item`} to={`${url} ${nav.path}`}> {nav.li} </Link>
                )}

            </ul>

                    {/* <Link to={`${url}/manage-product`}>

                    </Link>
                    <Link to={`${url}/manage-inventory`}>

                    </Link>
                    <Link to={`${url}/manage-payments`}>

                    </Link>
                    <Link to={`${url}/manage-accounts`}>

                    </Link> */}

                    <Switch>
                    <Route exact path="/manage-product">
                        <Product/>
                    </Route>
                    <Route exact path="/manage-inventory">
                        <Inventory/>
                    </Route>
                    <Route exact path="/manage-payments">
                        <Payment/>
                    </Route>
                    <Route exact path="/manage-accounts">
                        <Account/>
                    </Route>
                </Switch>
            </Router>
            </div>
)
}

export default withRouter(AdminDashboard);
